import React, { Component } from 'react';

class HobulhoApp extends Component {
  constructor(props){
    super(props);
    this.props = props;
    this.state = {
      question:0,
      answers:{
        1:"dislike",
        2:"dislike",
        3:"dislike",
        4:"dislike",
        5:"dislike",
        6:"dislike",
      },
    }
  }
  render() {
    return (
      <div> <ol>
        {this.props.questions.map((obj,ind)=><li>{[obj.subject,obj.choice]}</li>)}
      </ol> </div>
    );
  }
}

export default HobulhoApp;
